import React, { Component } from "react";

import api from "../api";

class Admin extends Component {
  state = {
    saves: [],
  };

  componentDidMount() {
    api
      .saves("Histopolio")
      .then((res) => {
        this.setState({
          saves: res.data,
        });
      })
      .catch((error) => {
        console.log(error.message);
      });
  }

  render() {
    return (
      <div className="text-center">
        {this.state.saves.map((save) => {
          return <p>{save}</p>;
        })}
      </div>
    );
  }
}

export default Admin;
